import React, { useEffect, useState } from 'react'
import './style.component.css'
import { useNavigate } from 'react-router-dom'
import axios from 'axios'
const API_URL = process.env.REACT_APP_API_URL;

const Footer = () => {

  const navigate = useNavigate();
  const[ footer, setFooter] = useState([]);
  const[social ,setSocial] = useState([]);

  useEffect(()=>{
    Footer_API();
  },[]);
  
  
    const Footer_API = async() => {
      try{
        const response = await axios.get(`${API_URL}/api/global?populate[footer][populate]=*`);
        setFooter(response.data.data.attributes.footer[0].links);
        setSocial(response.data.data.attributes.footer[1].links)
        console.log(response.data,'Footer-social');
        console.log(footer,'Footer');

      }catch(e){
        console.error(e);
      }
    }

  return (
    <footer className="frame-container bg-gray1 bottom-0 ">
      <div className="frame-div">
        <div className="frame-parent1">
          <div className="heading-1-the-london-hairdre-wrapper">
            <h2 className="heading-11">An Indian Hairdressing Academy</h2>
            
            <div class="icons">
            <a href=''> <i class="fa fa-facebook"></i></a>
            <a href=''> <i class="fa fa-instagram"></i></a>
            <a href=''> <i class="fa-brands fa-youtube"></i></a>
            <a href=''> <i class="fa-brands fa-x-twitter"></i></a>
            <a href=''> <i class="fa fa-linkedin"></i></a>
            </div>

                </div>
              {footer.map((foot) =>(
                <div className="nav-list-item-link-her-group" key={foot.id}>
                <a className="nav-list1" onClick={()=>{navigate(`${foot.href}`)} }>
                  {foot.label}
                  </a>
                </div>
              ))}
                </div>
                </div>
    </footer>
  )
}

export default Footer
